// ==UserScript==
// @name        MoEMax
// @namespace   moemax
// @description 不安なものをみえなくしたい
// @include     http://moepic.com/
// @include     https://moepic.com/
// @grant       none
// @version     1
// ==/UserScript==
(function(d, func) {
    var check = function() {
        if (typeof unsafeWindow.jQuery == 'undefined') return false;
        func(unsafeWindow.jQuery); return true;
    }
    if (check()) return;
    var s = d.createElement('script');
    s.type = 'text/javascript';
    s.src = 'http://ajax.googleapis.com/ajax/libs/jquery/1.9.1/jquery.min.js';
    d.getElementsByTagName('head')[0].appendChild(s);
    (function() {
        if (check()) return;
        setTimeout(arguments.callee, 100);
    })();
})(document, function($) {
    var bg = "";
        $("body").css("background-image",'url("data:image/png;base64,'+bg+'")');
});


